const uint32_t* get_font_glyph(char ch) {
    // This is a simple linear search. For performance, you may want to use a lookup table.
    const char* char_set = " !\"#$%&'()*+,-./0123456789:;<=>?@ABCDEFGHIJKLMNOPQRSTUVWXYZ[\\]^_`abcdefghijklmnopqrstuvwxyz{|}~";
    for (int i = 0; i < FONT_NUM_GLYPHS; ++i) {
        if (char_set[i] == ch) {
            return font_glyphs[i];
        }
    }
    // Return a default glyph (e.g., for a non-printable character)
    return font_glyphs[0];
}

void term_draw_char(uint8_t ch, int x, int y, uint32_t color) {
    // Get a pointer to the start of the glyph's pixel data from the font array.
    const uint32_t *glyph_data = get_font_glyph(ch);

    // Unpack the base color's components for blending.
    uint8_t base_r = (color >> 16) & 0xFF;
    uint8_t base_g = (color >> 8) & 0xFF;
    uint8_t base_b = color & 0xFF;

    // Loop through each pixel of the glyph.
    for (int i = 0; i < FONT_GLYPH_HEIGHT; i++) {
        for (int j = 0; j < FONT_GLYPH_WIDTH; j++) {
            // Get the 32-bit RGBA pixel from the glyph data.
            uint32_t pixel_color = glyph_data[i * FONT_GLYPH_WIDTH + j];

            // Extract the alpha channel of the pixel.
            uint8_t alpha = (pixel_color >> 24) & 0xFF;

            // If the pixel is not fully transparent, calculate the blended color.
            if (alpha > 0) {
                // The glyph is drawn in pure white, so we simply multiply the
                // base color's components by the alpha value to get the new color.
                // Note: The alpha value here scales the intensity of the base color.
                uint8_t final_r = (base_r * alpha) / 255;
                uint8_t final_g = (base_g * alpha) / 255;
                uint8_t final_b = (base_b * alpha) / 255;
                uint32_t final_color = (0xFF000000 | (final_r << 16) | (final_g << 8) | final_b);

                // Draw the pixel with the blended color.
                gfx_draw_pixel(x + j, y + i, final_color);
                // gfx_draw_pixel_direct(x + j, y + i, final_color);
            }
        }
    }
}

void term_draw_str(int x, int y, char *s, uint32_t color)
{
    while (*s) {
        if (*s == '\r') {
            x = 0;
        } else if(*s == '\n') {
            x = 0; y += FONT_GLYPH_HEIGHT;
        } else {
	        term_draw_char(*s, x, y, color);
            x += FONT_GLYPH_WIDTH;
        }
        s++;
    }
}